import VueRouter from 'vue-router'
import UserList from '../pages/userlist/UserList.vue'


const router = new VueRouter({
	routes: [{
		name: 'userlist',
		path: '/userlist',
		component: UserList,
		meta: {
			title: 'userlist'
		}

	}]
})

export default router
